import React from 'react'
import {
    Typography,Avatar,Grid,Box
}from "@material-ui/core"
import silas_image from "../images/Silas.jpg"
import  Typed from "react-typed"
import { makeStyles } from '@material-ui/core/styles';

//make css style
const useStyle = makeStyles(theme => ({
    avatar :{
        height: theme.spacing(30),
        width : theme.spacing(30),
        margin : theme.spacing(1),
    }
}))

const Header = () => {
    const classes = makeStyles();
    return (
        <Box>
            <Avatar sytle={classes.avatar} src={silas_image} alt="Silas"/>
            <Typography variant="h4">
                <Typed strings={['IP PUI KIT, SILAS']} typeSpeed={40}/>
            </Typography>
            <br/>
            <Typography variant="h5">
                <Typed strings={['I am looking Web Developer Job','Please Contact Me']}
                 typeSpeed={40} 
                 backSpeed={60}
                 loop/>
            </Typography>
        </Box>
    )
}

export default Header
